package reflectx

func icall(i int, bytes int, ret bool, ptrto bool) (index int, v interface{}) {
	if i > max_icall_index || bytes > max_icall_bytes {
		index = -1
		return
	}
	index = bytes/4 + i*(max_icall_bytes/4+1)
	if ptrto {
		if ret {
			v = icall_ptr[index]
		} else {
			v = icall_ptr_n[index]
		}
	} else {
		if ret {
			v = icall_struct[index]
		} else {
			v = icall_struct_n[index]
		}
	}
	return
}

